import React from "react";

const PendingPartner = ({ partner, onApprove }) => {
  if (!partner) return null;

  return (
    <div 
      style={{
        padding: "16px",
        marginBottom: "12px",
        border: "1px solid #ccc",
        borderRadius: "10px",
        background: "#fafafa"
      }}
    >
      <h3 style={{ marginBottom: "8px" }}>
        {partner.name || "Unnamed Partner"}
      </h3>

      <p><strong>Email:</strong> {partner.email || "N/A"}</p>
      <p><strong>Phone:</strong> {partner.phone || "N/A"}</p>
      <p><strong>City:</strong> {partner.city || "N/A"}</p>
      <p><strong>Address:</strong> {partner.address || "N/A"}</p>

      <p>
        <strong>Categories:</strong>{" "}
        {partner.categories?.length > 0
          ? partner.categories.join(", ")
          : "No categories selected"}
      </p>

      <p><strong>Aadhaar:</strong> {partner.aadhaarNumber || "N/A"}</p>
      <p><strong>PAN:</strong> {partner.panNumber || "N/A"}</p>
      <p><strong>Bank:</strong> {partner.bankName || "N/A"}</p>
      <p><strong>Account Number:</strong> {partner.accountNumber || "N/A"}</p>
      <p><strong>IFSC:</strong> {partner.ifscCode || "N/A"}</p>

      <p><strong>KYC Submitted:</strong> {partner.kycSubmitted ? "Yes" : "No"}</p>
      <p><strong>KYC Verified:</strong> {partner.kycVerified ? "Yes" : "No"}</p>

      {!partner.approved && (
        <button
          onClick={() => onApprove(partner.id)}
          style={{
            marginTop: "10px",
            padding: "10px 14px",
            background: "#4CAF50",
            color: "#fff",
            border: "none",
            borderRadius: "6px",
            cursor: "pointer",
          }}
        >
          Approve Partner
        </button>
      )}
    </div>
  );
};

export default PendingPartner;
